import { Box, Button, FormControl, FormLabel, Heading, Input, TableContainer, Thead, Tr, Th, Td, Table, Flex, Tbody } from "@chakra-ui/react";
import SidebarSuperAdmin from "../../components/SidebarSuperAdmin";
import api from "../../services/api";
import { useEffect, useState } from "react";


const FishData = () => {

    // state data to save response data fish
    const [dataFish, setDataFish] = useState([]);

    // fetching data from axios to get all fish data
    const getFish = async () => {
        try {
            const response = await api.get(`/api/v3/fish`);
            setDataFish(response.data.payload);
        } catch (error) {
            console.log(error);
        }
    }

    console.log(dataFish);

    useEffect(() => {
        getFish();
    }, []);
    return(
        <>
            <Box bgColor={"#F5F7FA"} bgSize={"cover"} height={"100vh"} display={"flex"}>
                <SidebarSuperAdmin/>

                <Box margin={"50px"} width={"7xl"} display={"flex"} flexDirection={"column"} marginLeft={"280px"}>
                   
                   <Box marginLeft={"10px"} marginTop={"20px"} >
                        <Heading>Fish Data</Heading>
                    </Box>

                    <Box padding={"30px"} display={"flex"} flexDirection={"column"} bgColor={"#FFFFFF"} borderRadius={"30px"} marginTop={"40px"} minHeight={"75vh"}>
                        <Box>
                            <Button marginLeft={"90%"} bgColor={"#4CAF4F"} borderRadius={"10px"}>+ Add</Button>
                        </Box>
                        
                        <Box bgColor={"whitesmoke"} boxSize={"6xl"} marginTop={"25px"} borderRadius={"20px"} marginLeft={"10px"}>
                        <TableContainer>
                                <Table variant={"striped"}>
                                    <Thead>
                                        <Tr>
                                            <Th>Id</Th>
                                            <Th>Name</Th>
                                            <Th>Minimal Price</Th>
                                            <Th>Maximal Price</Th>
                                            <Th paddingLeft={"55px"}>Action</Th>
                                        </Tr>
                                    </Thead>
                                    <Tbody>
                                        {dataFish && dataFish.map(fish => (
                                        <Tr key={fish.id}>
                                            <Td>{fish.id}</Td>
                                            <Td>{fish.name}</Td>
                                            <Td>Rp. {fish.min_price}</Td>
                                            <Td>Rp. {fish.max_price}</Td>
                                            <Td>
                                                <Flex gap={"2"}>
                                                    <Button size={"sm"} colorScheme="blue" borderRadius={"40px"}>Edit</Button>
                                                    <Button size={"sm"} colorScheme="red" borderRadius={"40px"}>Delete</Button>
                                                </Flex>    
                                            </Td>                                
                                        </Tr>
                                        ))}
                                    </Tbody>
                                </Table>
                            </TableContainer>
                        </Box>
                    </Box>
                </Box>
            </Box>

            {/* <FormControl isRequired width={"100%"}>
                <Box width={"40%"}>
                <FormLabel>Id</FormLabel>
                <Input placeholder="id" type="text" marginBottom={"20px"}></Input>

                <FormLabel>Name</FormLabel>
                <Input placeholder="fish name" type="text" marginBottom={"20px"}></Input>

                <FormLabel>Minimal Price</FormLabel>
                <Input placeholder="min price /kg" type="number" marginBottom={"20px"}></Input>

                <FormLabel>Maximal Price</FormLabel>
                <Input placeholder="max price /kg" type="number" marginBottom={"20px"}></Input>
                </Box>
                </FormControl> */}
        </>
    )
}

export default FishData;
